  constructor(){
  super()
  this.state = {
    book: '',
    read: 0
  }
}


onHandlerRead = () =>{
  this.setState({
    read: 1
  })
}





  render() {
    return (
      <div className = {`${this.bg.current.selectedItem === 'BarberShop' ? 'barber' : 'salon'}`} >
        <Blayout 
          items = {[
            {value: 'BarberShop', id: 0},
            {value: 'ParloSalon', id: 1},
            {value: 'TattoParlo', id: 2},


            ]}
            ref = "child"

            bground = {this.onBGroundChange}

        />
        <Media /> 
        <button onClick = {this.onHandlerRead}> click </button>
        <div>{this.state.read}</div>


      </div>
    );
  }
}

export default App;
